'''''The Lord of the Rings Location Guidebook: Travel Diary''''' is a book by [[Ian Brodie]] that is a companion to his ''[[The Lord of the Rings Location Guidebook]]''.

==From the publisher==
{{blockquote|With the help of The Lord of the Rings Location Guidebook, thousands of fans worldwide have been able to follow Peter Jackson and the Fellowship as they experience the spectacular locations where the Oscar-winning The Lord of the Rings movie trilogy was created.

In this unique diary, especially created to accompany Ian Brodie's best-selling guidebook series, travelers can re-create their own journey with diary entries, photographs and even a pressed flower from Ithilien or a leaf from Rivendell. Beautifully packaged, this is a must-have item for anyone wishing to preserve special memories and thoughts as they walk in Frodo's footsteps.}}

